<div class="entities" style="line-height: 2.5; direction: ltr">A diarylheptanoid from lesser galangal ( Alpinia officinarum ) inhibits proinflammatory mediators via inhibition of mitogen-activated protein kinase , Q8TCB0 / 42 , and transcription factor nuclear factor-kappa B . The diarylheptanoid 7 - ( 4 ' - hydroxy - 3 ' - methoxyphenyl ) - 1 - phenylhept - 4 - en - 3 - one ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q16891
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) is a naturally occurring phytochemical found in lesser galangal ( Alpinia officinarum ) . In the present study , we have demonstrated the anti-inflammatory properties of this compound on mouse macrophage cell line ( RAW 264.7 ) and human peripheral blood mononuclear cells ( PBMCs ) in vitro . Treatment of RAW 264.7 cells with 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q16891
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ( 6.25- 25 microM ) significantly inhibited lipopolysaccharide ( LPS ) - stimulated nitric oxide ( NO ) production . This compound also inhibited the release of LPS-induced proinflammatory cytokines interleukin - 1 beta ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01584
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) and tumor necrosis factor-alpha ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01375
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) from human PB-MCs in vitro . In addition , Western blotting and reverse transcription-polymerase chain reaction analysis demonstrated that 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q16891
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 decreased LPS-induced inducible nitric-oxide synthase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35228
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) and cyclooxygenase - 2 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35354
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) protein and mRNA expression in RAW 264.7 cells . Furthermore , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q16891
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 treatment also reduced nuclear factor-kappa B ( NF-kappa B ) DNA binding induced by LPS in RAW 264.7 cells . To elucidate the molecular mechanism for inhibition of proinflammatory mediators by 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q16891
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ( 25 microM ) , we have studied the effect of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q16891
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 on LPS-induced p38 and Q8TCB0 / 42 mitogen-activated protein kinase ( MAPK ) . We observed that the phosphorylation of Q8TCB0 / 42 MAPK in LPS-stimulated RAW 264.7 cells was markedly inhibited by 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q16891
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , whereas activation of p38 MAPK was not affected . These results suggested that 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q16891
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 from lesser galangal suppressed the LPS-induced production of NO , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01584
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01375
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and expression of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35228
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and

<div class="entities" style="line-height: 2.5; direction: ltr">Methodological challenges in monitoring new treatments for rare diseases : lessons from the cryopyrin-associated periodic syndrome registry . BACKGROUND : The 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q96P20
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - Associated Periodic Syndromes ( CAPS ) are a group of rare hereditary autoinflammatory diseases and encompass Familial Cold Autoinflammatory Syndrome ( FCAS ) , Muckle-Wells Syndrome ( MWS ) , and Neonatal Onset Multisystem Inflammatory Disease ( NOMID ) . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06168
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 is a monoclonal antibody directed against 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01584
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and approved for CAPS patients but requires post-approval monitoring due to low and short exposures during the licensing process . Creative approaches to observational methodology are needed , harnessing novel registry strategies to ensure Health Care Provider reporting and patient monitoring . METHODS : A web-based registry was set up to collect information on long-term safety and effectiveness of canakinumab for CAPS . RESULTS : Starting in November 2009 , this registry enrolled 241 patients in 43 centers and 13 countries by December 31 , 2012 . One-third of the enrolled population was aged &lt; 18 ; the overall population is evenly divided by gender . Enrolment is ongoing for children . CONCLUSIONS : Innovative therapies in orphan diseases require post-approval structures to enable in depth understanding of safety and natural history of disease . The rarity and distribution of such diseases and unpredictability of treatment require innovative methods for enrolment and follow-up . Broad international practice-based recruitment and web-based data collection are practical .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Effect of canagliflozin on renal threshold for glucose , glycemia , and body weight in normal and diabetic animal models . BACKGROUND :

 is a sodium glucose co-transporter ( SGLT ) 2 inhibitor in clinical development for the treatment of type 2 diabetes mellitus ( T2DM ) . METHODS : ( 14 ) C-alpha-methylglucoside uptake in Chinese hamster ovary-K cells expressing human , rat , or mouse SGLT 2 or 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ; ( 3 ) H - 2 - deoxy-d-glucose uptake in Q9BTT4 myoblasts ; and 2 - electrode voltage clamp recording of oocytes expressing human SGLT 3 were analyzed . Graded glucose infusions were performed to determine rate of urinary glucose excretion ( UGE ) at different blood glucose ( BG ) concentrations and the renal threshold for glucose excretion ( RT ( G ) ) in vehicle or canagliflozin-treated Zucker diabetic fatty ( ZDF ) rats . This study aimed to characterize the pharmacodynamic effects of canagliflozin in vitro and in preclinical models of T2DM and obesity . RESULTS : Treatment with canagliflozin 1 mg / kg lowered RT ( G ) from 415  12 mg / dl to 94  10 mg / dl in ZDF rats while maintaining a threshold relationship between BG and UGE with virtually no UGE observed when BG was below RT ( G ) . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 dose-dependently decreased BG concentrations in db / db mice treated acutely . In ZDF rats treated for 4 weeks , canagliflozin decreased glycated hemoglobin ( HbA 1c ) and improved measures of insulin secretion . In obese animal models , canagliflozin increased UGE and decreased BG , body weight gain , epididymal fat , liver weight , and the respiratory exchange ratio . CONCLUSIONS : 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB08907

 lowered RT ( G ) and increased UGE , improved glycemic control and beta-cell function in rodent models of T2DM , and reduced body weight gain in rodent models of obesity .</div>

<h2 style="margin: 0">4</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">[ 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35354
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 inhibitor non-steroidal anti-inflammatory drugs , myth or reality ? ] . The discovery of two isoforms of cyclooxygenase , Cox - 1 constitutive and Cox - 2 inducible , has prompted the development of new molecules with high Cox - 2 selectivity . These new NSAIDs belong to the coxib class and have theoretically a better digestive tolerability than classical NSAID have . In Belgium , rofecoxib ( ( Vioxx ) and celecoxib ( DB00482 ) are commercialized . DB00533 is indicated in the symptomatic treatment of osteoarthritis ( 12.5 to 25 mg / d ) and celecoxib is indicated in osteoarthritis ( 200 mg / d ) and in rheumatoid arthritis ( 200 to 400 mg / d ) . Several studies have demonstrated their efficacy , similarly to classical NSAID as diclofenac ( Voltaren ) , naproxen ( Naprosyne ) , ibuprofen ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01050
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ) and their superiority compared to placebo . Their safety profile for gastrointestinal events is proven in patients without ulcer history compared to classical NSAID . However , the concomitant use of aspirin decreases the benefit as demonstrated for celecoxib at 400 mg / d but not investigated for rofecoxib . The selective inhibition of Cox - 2 with no effect on Cox - 1 favors cardiovascular events in patients at risk . Other side effects are similar to classical NSAID . Thus Cox - 2 inhibitors NSAID are interesting molecules for their sparing gastrointestinal activity . They must be used with caution in patients with ulcer history , in the elderly and in patients requiring aspirin for cardiovascular prophylaxis .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Salacia oblonga extract increases glucose transporter 4 - mediated glucose uptake in Q9BTT4 rat myotubes : role of mangiferin . BACKGROUND AND AIMS : To evaluate if the antidiabetic properties of Salacia oblonga extract are mediated not only by inhibiting intestinal alpha-glycosidases but also by enhancing glucose transport in muscle and adipose cells . METHODS : S . oblonga extract effects on 2 - deoxy-D-glucose uptake were assayed in muscle Q9BTT4 - myotubes and 3T3 - adipocytes . In Q9BTT4 - myotubes , the amount and translocation of glucose transporters were assayed . A fractionation of the extract was carried out to identify the active compounds . Furthermore , we analyzed the phosphorylation status of key components of signaling pathways that are involved in the molecular mechanisms regulating glucose uptake . RESULTS : S . oblonga extract increased 2 - deoxy-D-glucose uptake by 50 % in Q9BTT4 - myotubes and 3T3 - adipocytes . In Q9BTT4 - myotubes , the extract increased up to a 100 % the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 content , activating 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P14672

</mark>
 promoter transcription and its translocation to the plasma membrane . Mangiferin was identified as the bioactive compound . Furthermore , mangiferin effects were concomitant with the phosphorylation of DB00131 - activated protein kinase without the activation of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 / Akt . The effect of mangiferin on 2 - deoxy-D-glucose uptake was blocked by GW9662 , an irreversible

 antagonist . CONCLUSIONS : S . oblonga extract and mangiferin may exert their antidiabetic effect by increasing

 expression and translocation in muscle cells . These effects are probably mediated through two independent pathways that are related to DB00131 - activated protein kinase and

 .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Critical role of aquaporins in interleukin 1 ( IL - 1 ) - induced inflammation . Rapid changes in cell volume characterize macrophage activation , but the role of water channels in inflammation remains unclear . We show here that , in vitro , aquaporin ( AQP ) blockade or deficiency results in reduced IL - 1 release by macrophages activated with a variety of

</mark>
 activators . Inhibition of AQP specifically during the regulatory volume decrease process is sufficient to limit IL - 1 release by macrophages through the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 inflammasome axis . The immune-related activity of AQP was confirmed in vivo in a model of acute lung inflammation induced by crystals . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 deficiency is associated with a marked reduction of both lung IL - 1 release and neutrophilic inflammation . We conclude that AQP-mediated water transport in macrophages constitutes a general danger signal required for 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ) plays a key role in regulating inflammation .

 , a phosphodiesterase ( PDE ) 4 - selective inhibitor , has recently been approved for treating severe chronic obstructive pulmonary disease (

 ) patients with exacerbation . However , there is also clinical evidence suggesting the development of tachyphylaxis or tolerance on repeated dosing of roflumilast and the possible contribution of

 up-regulation , which could be counterproductive for suppressing inflammation . Thus , understanding how

 is up-regulated in the context of the complex pathogenesis and medications of

 may help improve the efficacy and possibly ameliorate the tolerance of roflumilast . Here we show that roflumilast synergizes with nontypeable Haemophilus influenzae ( NTHi ) , a major bacterial cause of

 exacerbation , to up-regulate PDE 4B2 expression in human airway epithelial cells in vitro and in vivo . Up-regulated PDE 4B2 contributes to the induction of certain important chemokines in both enzymatic activity-dependent and activity-independent manners . We also found that protein kinase A catalytic subunit  ( PKA-C ) and nuclear factor-B ( NF-B ) p65 subunit were required for the synergistic induction of PDE 4B2 . PKA-C phosphorylates p65 in a DB02527 - dependent manner . Moreover , Ser 276 of p65 is critical for mediating the PKA-C-induced p65 phosphorylation and the synergistic induction of PDE 4B2 . Collectively , our data unveil a previously unidentified mechanism underlying synergistic up-regulation of PDE 4B2 via a cross-talk between PKA-C and p65 and may help develop new therapeutic strategies to improve the efficacy of DB05876 inhibitor .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Characterization of the aggregation responses of camel platelets . BACKGROUND : Despite evidence of active hemostasis , camel platelets barely respond to common aggregating agents at standard doses used for human platelet aggregation . OBJECTIVES : The purpose of the study was to find out whether camel platelets can be activated by high doses or combinations of aggregation agonists , and to characterize the receptor that mediates the aggregation response to adenosine diphosphate ( ADP ) , the most potent agonist for camel platelets known so far . METHODS : Aggregation studies were performed with platelet-rich plasma ( PRP ) in response to multiple doses or combinations of ADP , epinephrine (

 ) , collagen , and arachidonic acid ( AA ) . Aggregation responses to ADP were performed before and after the addition of the ADP receptor (

 ) antagonist

 . RESULTS : Camel platelets responded to ADP at doses higher than the standard dose for human platelets , and to combinations of

 and other agonists , while no aggregation was elicited with

 . Irreversible aggregation of camel platelets could also be triggered by a combination of

 . Understanding platelet function in camels will add to the understanding of platelet function in health and disease .</div>

<h2 style="margin: 0">15</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Estradiol or genistein prevent Alzheimer ' s disease-associated inflammation correlating with an increase 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 gamma expression in cultured astrocytes . Inflammation has been implicated in neurodegenerative disorders such as Alzheimer ' s disease ( AD ) . The main inflammatory players in AD are the glial cells which initiate the inflammatory response . One of the earliest neuropathological changes in AD is the accumulation of astrocytes at sites of A beta deposition . It is desirable to find methods of tipping the balance towards anti-inflammatory state . Estrogenic compounds have shown anti-inflammatory and also antioxidant activity . Astrocytes were pretreated with 17 - beta estradiol or with genistein , and 48 h later treated with 5 microM amyloid beta ( A beta ) for 24 h . We found that A beta induces inflammatory mediators , such as cyclooxygenase 2 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35354

</mark>
 ) , inducible nitric oxide synthase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35228
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) , interleukin 1 beta ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01584
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) and tumor necrosis factor alpha ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01375
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) . All these effects were prevented when cells were pretreated with estradiol or genistein , demonstrating anti-inflammatory effects of estradiol or genistein in astrocytes in primary culture . The A beta-stimulated expression of pro-inflammatory genes in cells is antagonized by the action of the PPARs ( peroxisome proliferator activated receptors ) . Here we detected an increase in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P37231
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 expression in astrocytes in primary culture treated with A beta and estradiol or soy isoflavone genistein . Thus , some of the anti-inflammatory effects of estrogenic compounds may be mediated and activated by PPARs suppressing a diverse array of inflammatory responses caused by A beta in astrocytes in primary culture .</div>
